local HotBar = {}
HotBar.filePath = "custom/__config_HecticHotBar.json"
HotBar.defaultConfig = {
	settings= {
		command="hotbar",
		autoUpdateOnQuickKeyChange=true,
		cleanChatWindowOnUpdate=true,
		colors={
			slotNumbers="#FFFF00",
			items="#789922",
			deviderLines="#ffffff"
		}
	},
	customItems= {
		example="example",
		refId="name",
		custom_sword_from_TR="Tamriel's Peacekeeper Sword",
		item_from_addon="Name of the Item"
	}
}

HotBar.loadConfig = function()
	local config = jsonInterface.load(HotBar.filePath)
	if config == nil then
		jsonInterface.save(HotBar.filePath, HotBar.defaultConfig)
		config = HotBar.defaultConfig
	end
	return config
end

HotBar.createHotbar = function(pid)
    quickKeys = Players[pid].data.quickKeys
    possiblePatterns = {["custom_armor"]="armor",["custom_book"]="book", ["custom_clothing"]="clothing", ["custom_creature"]="creature", ["custom_enchantment"]="enchantment", ["custom_miscellaneous"]="miscellaneous", ["custom_npc"]="npc", ["custom_potion"]="potion", ["custom_spell"]="spell", ["custom_weapon"]="weapon"}
    message = ""
    for i = 1,9,1 
    do 
        toAppend = " -"
        if quickKeys[i] ~= nil then
            itemId = quickKeys[i].itemId
            if itemId ~= nil and itemId ~= '' then
                toAppend = itemId
                found = false

                for key,value in pairs(possiblePatterns)
                do
                    if string.find(itemId, key) ~= nil then
                        store = RecordStores[value]
                        customItem = store.data.generatedRecords[itemId].name
                        if customItem ~= nil then
                        	found = true
                        	toAppend = customItem
                    	end
                    end
                end

                if found == false then
                	addonItem = HotBar.config.customItems[itemId]
                	if addonItem ~= nil then
                		found = true
            			toAppend = addonItem
            		end
                end

                if found == false then
                	baseItem = HotBar.baseGameItemIds[itemId]
                    if baseItem ~= nil then
                        toAppend = baseItem
                    end
                end
            end
        end
        message = message .. HotBar.config.settings.colors.slotNumbers .. i .. ": " .. HotBar.config.settings.colors.items .. toAppend .. HotBar.config.settings.colors.deviderLines ..  " | " 
    end
    if HotBar.config.settings.cleanChatWindowOnUpdate then
		tes3mp.CleanChatForPid(pid)
	end
    Players[pid]:Message(message .. "\n")
end

